			shellScript = "# Type a script or drag a script file from your workspace to insert its path.\n\n# for debugging/inspection purposses:\n# for line in $(printenv); do echo $line; done\n\n# for a RELEASE our current HEAD has a tag. we use this tag as version,\n# assuming that the tag format is release/x.y.z[bla]. during development\n# this number is quite a mess. after building the version is correct\nrelease=$(basename $(git describe --tags --always))\n\n# to be conform with some apple requirements (see above bundle version) we use release + hash\n# build=$release-$(git log --oneline HEAD^1.. | awk '{print $1 }')\n# or\n# build=$(git describe --tags --always --dirty)\n# build=`git log -n1 --date=short --format=\"%ad (%h)\"`\nbuild=$(git describe --dirty)\n\n# the plist file to be modified\nplist_path=$INFOPLIST_FILE\n\n# the build configuration (Debug|Release)\n#echo $CONFIGURATION\n\n# PlistBuddy executable\nPLISTBUDDY=/usr/libexec/PlistBuddy\n\n#\n# set the \"short version\" to $build\n#\n\n# add :CFBundleShortVersionString if it does not exits\n$PLISTBUDDY -c \"Print :CFBundleShortVersionString\" \"$plist_path\" >> /dev/null 2>> /dev/null\n# Plistbuddy returns 0 on success\nhasnot_CFBundleShortVersionString=$?\nif [ $hasnot_CFBundleShortVersionString -ne 0 ]; then\n  $PLISTBUDDY -c \"Add :CFBundleShortVersionString string\" \"$plist_path\"\nfi\n# set :CFBundleShortVersionString\n$PLISTBUDDY -c \"Set :CFBundleShortVersionString $release\" \"$plist_path\"\n\n#\n# if this is a RELEASE build then set CFBundleVersion to $release, else to build\n#\n\n# add :CFBundleVersion if it does not exits\n$PLISTBUDDY -c \"Print :CFBundleVersion\" \"$plist_path\" >> /dev/null 2>> /dev/null\n# Plistbuddy returns 0 on success\nhasnot_CFBundleVersion=$?\nif [ $hasnot_CFBundleVersion -ne 0 ]; then\n  $PLISTBUDDY -c \"Add :CFBundleVersion string\" \"$plist_path\"\nfi\n# set :CFBundleVersion\ncase $CONFIGURATION in\n  Release)  $PLISTBUDDY -c \"Set :CFBundleVersion $release\" \"$plist_path\";;\n  *)        $PLISTBUDDY -c \"Set :CFBundleVersion $build\" \"$plist_path\";;\nesac\n\n# end-of-file\n";
